import styled from "styled-components";

export const StyledFooter = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  background-color: black;
  color: white;
  height: 10px;
  width: 100%;
  position: fixed;
  bottom: 0;
  left: 0;
`
